      this.state={
         data:[{
           "id":1,

         },
         {
            "id":2,
         },
         {
            "id":3,
         }]
      }
   }
   render(){
       return (
         <div>
            <Welcome
                 mensaje="Hola es un mensaje"
             />
            <Card
                                title="Card"
                                description="Hoy estamos juntos"
                                colorLeft="blue"
                                colorRight="black"
            />
         
         </div>
       )
   }
}

export default Page
